	<div id="KiTTs_journey_began_with_us_ch">
		<span>KiTT’s</span><span style="font-style:normal;font-weight:normal;"> journey began with us challenging the status quo of how typical advisory services are delivered. The goal was to offer quality advisory services on favourable terms to early stage companies.</span>
	</div>
	<div id="Entrepreneurs_have_limited_tim">
		<span>Entrepreneurs have limited time and financial resources. Implementing advice received is also challenging, often limiting the impact felt from advisory services.<br/><br/>Putting ourselves in their shoes, we set out to efficiently package our experience, perspectives and ideas. Not compromising on quality and focusing on the most impactful areas was key.</span><br>
	</div>
	<div id="KiTT__is_the_result_focusing_o">
		<span>KiTT</span><span style="font-style:normal;font-weight:normal;color:rgba(124,124,124,1);">  is the result, focusing on business model and scalability advisory services. We believe that these are the building blocks central to growing a great business. <br/><br/>Our framework “Why and how you sell what to whom” factors in the limitations in time, financial resources and implementation. <br/></span><br><span style="font-style:normal;font-weight:bold;">You, the entrepreneur, are at the heart of KiTT’s design.</span>
	</div>
